import logo from "./logo.svg";
import "./App.css";
import { Button, Icon, Menu, Header, Image } from "semantic-ui-react";
import React, { Component } from "react";
import Background from "./blockchain_bg.jpg";

class App extends Component {
  handleItemClick = (e, { name }) => this.setState({ activeItem: name });
  render() {
    return (
      <div className="background-image App App-header">
        <Image centered src={Background} size="large" circular />
        <Header icon as="h1" style={{ color: "white" }}>
          <Header.Content>Shri Raghu Raaman</Header.Content>
        </Header>
      </div>
    );
  }
}

export default App;
